  Route,
  Switch,
  Link,
  withRouter,
  Redirect
} from "react-router-dom";

import {
    BoxFooter,
    ContainerFooter,
    RowFooter,
    ColumnFooter,
    HeadingFooter,
    ImgagingFooter
