function Footer() {
  return (
    <BoxFooter>
    <ContainerFooter>
    <RowFooter>
      <ColumnFooter>
       <ImgagingFooter src={logosize} alt="Download" />
      </ColumnFooter>
      <ColumnFooter>
        <HeadingFooter>
           Wander Wisely with the PlanetPnP app
