             <br/>
             <br/>
             The Minimum Viable Product includes:
             <br/>   
                &bull; Tour guide locator
                <br/>
                &bull; Search features by city and region
                <br/> 
                &bull; Categories and recommended tours for art, music, food, sightseeing, historical eventsâ€¦
               
         </p>
        </HeadingFooter>
      </ColumnFooter>
    </RowFooter>
  </ContainerFooter>
  </BoxFooter>
  );
}

export default Footer;
